INSERT INTO `publication` (`publicationID`, `type`, `author`, `succeeds`, `title`, `isPublished`, `presType`, `keywords`, `publication`, `volume`, `number`, `publisher`, `eventTitle`, `eventType`, `isbn`, `issn`, `bookTitle`, `ePrintID`, `doi`, `uri`, `additionalInfo`, `abstract`, `date`, `eraRating`) VALUES (1,'article',1,NULL,'An investigation into the efficacy of avatar-based systems for student advice','pub',NULL,NULL,'EAI Endorsed Transactions on e-Learning','3','11','Institute for Computer Sciences, Social Informatics and Telecommunications Engineering (ICST)',NULL,NULL,NULL,'2032-9253',NULL,21013,'http://dx.doi.org/10.4108/eai.15-6-2016.151450','http://eprints.mdx.ac.uk/id/eprint/21013',NULL,'Student support is an important function in all universities. Most students expect access to support 24/7, but support staff cannot be available at all times of day. This paper addresses this problem, describing the development of an avatar-based system to guide students through the materials provided by a university student employability service. Firstly, students and staff were surveyed to establish the demand for such a system. The system was then constructed. Finally, the system was evaluated by students and staff, which led to a clearer understanding of the optimal role for avatar-based systems and consequent improvements to the system&rsquo;s functionality.','2016-06-15',NULL),(2,'article',2,NULL,'An investigation into the efficacy of avatar-based systems for student advice','pub',NULL,NULL,'EAI Endorsed Transactions on e-Learning','3','11','Institute for Computer Sciences, Social Informatics and Telecommunications Engineering (ICST)',NULL,NULL,NULL,'2032-9253',NULL,21013,'http://dx.doi.org/10.4108/eai.15-6-2016.151450','http://eprints.mdx.ac.uk/id/eprint/21013',NULL,'Student support is an important function in all universities. Most students expect access to support 24/7, but support staff cannot be available at all times of day. This paper addresses this problem,