cations Engineering (ICST)',NULL,NULL,NULL,'2032-9253',NULL,21013,'http://dx.doi.org/10.4108/eai.15-6-2016.151450','http://eprints.mdx.ac.uk/id/eprint/21013',NULL,'Student support is an important function in all universities. Most students expect access to support 24/7, but support staff cannot be available at all times of day. This paper addresses this problem, describing the development of an avatar-based system to guide students through the materials provided by a university student employability service. Firstly, students and staff were surveyed to establish the demand for such a system. The system was then constructed. Finally, the system was evaluated by students and staff, which led to a clearer understanding of the optimal role for avatar-based systems and consequent improvements to the system&rsquo;s functionality.','2016-06-15',NULL),(7,'conference_item',7,NULL,'Understanding collaboration in Global Software Engineering (GSE) teams with the use of sensors: introducing a multi-sensor setting for observing social and human aspects in project management','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','IE 2017 - 13th International Conference on Intelligent Environments (IE&rsquo;17)','conference','9781538619209','2472-7571','2017 International Conference on Intelligent Environments (IE), Seoul, 2017',22085,'https://doi.org/10.1109/IE.2017.40','http://eprints.mdx.ac.uk/id/eprint/22085',NULL,'This paper discusses on-going research in the ways Global Software Engineering (GSE) teams collaborate for a range of software development tasks. The paper focuses on providing the means for observing and understanding GSE team member collaboration including team coordination and member communication. Initially the paper provides the background on social and human issues relating to GSE collaboration. Next the paper describes a pilot study involving a simulation of virtual GSE teams working together with the use of asynchronous and synchronous communication over a virtual learning environment. The study considered the use of multiple data collection techniques recordings of SCRUM meetings, design and implementation tasks. Next, the paper discusses the use of a multi-sensor for observing human and social aspects of project management in GSE teams. The scope of the study is to provide the means for gathering data regarding GSE team coordination for project managers including member emotions, participation pattern in team discussions and potentially stress levels.','2017-11-23',NULL),(8,'conference_item',8,NULL,'Understanding collaboration in Global Software Engineering (GSE) teams with the use of sensors: introducing a multi-sensor setting for observing social and human aspects in project management','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','IE 2017 - 13th International Conference on Intelligent Environments (IE&rsquo;17)','conference','9781538619209','2472-7571','2017 International Conference on Intelligent Environments (IE), Seoul, 2017',22085,'https://doi.org/10.1109/IE.2017.40','http://eprints.mdx.ac.uk/id/eprint/22085',NULL,'This paper discusses on-going research in the ways Global Software Engineering (GSE) teams collaborate for a range of software development tasks. The paper focuses on providing the means for observing and understanding GSE team member collaboration including team coordination and member communication. Initially the paper provides the background on social and human issues relating to GSE collaboration. Next the paper describes a pilot study involving a simulation of virtual GSE teams working together with the use of asynchronous and synchronous communication over a virtual learning environment. The study considered the use of multiple data collection techniques recordings of SCRUM meetings, design and implementation tasks. Next, the paper discusses the use of a multi-sensor for observing human and social aspects of project management in GSE teams. The scope of the study is to provide the means for gathering data regarding GSE team coordination for project managers including member emotions, participation pattern in team discussions and potentially stress levels.','2017-11-23',NULL),(9,'conference_item',6,NULL,'Understanding collaboration in Global Software Engineering (GSE) teams with the use of sensors: introducing a multi-sensor setting for observing social and human aspects in project management','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','IE 2017 - 13th International Conference on Intelligent Environments (IE&rsquo;17)','conference','9781538619209','2472-7571','2017 International Conference on Intelligent Environments (IE), Seoul, 2017',22085,'https://doi.org/10.1109/IE.2017.40','http://eprints.mdx.ac.uk/id/eprint/22085',NULL,'This paper discusses on-going research in the ways Global Software Engineering (GSE) teams collaborate for a range of software development tasks. The paper focuses on providing the means for observing and understanding GSE team member collaboration including team coordination and member communication. Initially the paper provides the background on social and human issues relating to GSE collaboration. Next the paper describes a pilot study involving a simulation of virtual GSE teams working together with the use of asynchronous and synchronous communication over a virtual learning environment. The study considered the use of multiple data collection techniques recordings of SCRUM meetings, design and implementation tasks. Next, the paper discusses the use of a multi-sensor for observing human and social aspects of project management in GSE teams. The scope of the study is to provide the means for gathering data regarding GSE team coordination for project managers including member emotions, participation pattern in team discussions and potentially stress levels.','2017-11-23',NULL),(10,'conference_item',4,NULL,'Understanding collaboration in Global Software Engineering (GSE) teams with the use of sensors: introducing a multi-sensor setting for observing social and human aspects in project management','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','IE 2017 - 13th International Conference on Intelligent Environments (IE&rsquo;17)','conference','9781538619209','2472-7571','2017 International Conference on Intelligent Environments (IE), Seoul, 2017',22085,'https://doi.org/10.1109/IE.2017.40','http://eprints.mdx.ac.uk/id/eprint/22085',NULL,'This paper discusses on-going research in the ways Global Software Engineering (GSE) teams collaborate for a range of software development tasks. The paper focuses on providing the means for observing and understanding GSE team member collaboration including team coordination and member communication. Initially the paper provides the background on social and human issues relating to GSE collaboration. Next the paper describes a pilot study involving a simulation of virtual GSE teams working together with the use of asynchronous and synchronous communication over a virtual learning environment. The study considered the use of multiple data collection techniques recordings of SCRUM meetings, design and implementation tasks. Next, the paper discusses the use of a multi-sensor for observing human and social aspects of project management in GSE teams. The scope of the study is to provide the means for gathering data regarding GSE team coordination for project managers including member emotions, participation pattern in team discussions and potentially stress levels.','2017-11-23',NULL),(11,'conference_item',9,NULL,'Understanding collaboration in Global Software Engineering (GSE) teams with the use of sensors: introducing a multi-sensor setting for observing social and human aspects in project management','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','IE 2017 - 13th International Conference on Intelligent Environments (IE&rsquo;17)','conference','9781538619209','2472-7571','2017 International Conference on Intelligent Environments (IE), Seoul, 2017',22085,'https://doi.org/10.1109/IE.2017.40','http://eprints.mdx.ac.uk/id/eprint/22085',NULL,'This paper discusses on-going research in the ways Global Software Engineering (GSE) teams collaborate for a range of software development tasks. The paper focuses on providing the means for observing and understanding GSE team member collaboration including team coordination and member communication. Initially the paper provides the background on social and human issues relating to GSE collaboration. Next the paper describes a pilot study involving a simulation of virtual GSE teams working together with the use of asynchronous and synchronous communication over a virtual learning environment. The study considered the use of multiple data collection techniques recordings of SCRUM meetings, design and implementation tasks. Next, the paper discusses the use of a multi-sensor for observing human and social aspects of project management in GSE teams. The scope of the study is to provide the means for gathering data regarding GSE team coordination for project managers including member emotions, participation pattern in team discussions and potentially stress levels.','2017-11-23',NULL),(12,'conference_item',7,NULL,'Improving student employability by utilising semantic analysis of course data','pub','paper',NULL,NULL,NULL,NULL,NULL,'ICERI 2014 : 7th International Conference of Education, Research and Innovation','conference',NULL,NULL,NULL,16061,NULL,'http://eprints.mdx.ac.uk/id/eprint/16061',NULL,'This paper describes the development of a toolkit based on the semantic analysis of course data using the eXchanging Course Related Information &ndash; Course Advertising Profile (XCRI-CAP) information model. Based on the XCRI-CAP 1.2 standard, our research focused on providing the means for semantically comparing course descriptions and curriculum documentation. The paper provides an overview of how the JISC funded MUSAPI (Musket-Salami Project Integration) project resulted in the creation of a web service allowing (i) raising awareness regarding the architecture of job profiles and the employability terminology used in career services, (ii) identifying potential job opportunities for student graduates and/or university applicants, (iii) ranking &lsquo;real&rsquo; job opportunities filtered according to a range of criteria and (iv) mapping job opportunities to courses in higher education institutions offering the necessary skills and knowledge.','2014-11-17',NULL),(13,'conference_item',10,NULL,'Improving student employability by utilising semantic analysis of course data','pub','paper',NULL,NULL,NULL,NULL,NULL,'ICERI 2014 : 7th International Conference of Education, Research and Innovation','conference',NULL,NULL,NULL,16061,NULL,'http://eprints.mdx.ac.uk/id/eprint/16061',NULL,'This paper describes the development of a toolkit based on the semantic analysis of course data using the eXchanging Course Related Information &ndash; Course Advertising Profile (XCRI-CAP) information model. Based on the XCRI-CAP 1.2 standard, our research focused on providing the means for semantically comparing course descriptions and curriculum documentation. The paper provides an overview of how the JISC funded MUSAPI (Musket-Salami Project Integration) project resulted in the creation of a web service allowing (i) raising awareness regarding the architecture of job profiles and the employability terminology used in career services, (ii) identifying potential job opportunities for student graduates and/or university applicants, (iii) ranking &lsquo;real&rsquo; job opportunities filtered according to a range of criteria and (iv) mapping job opportunities to courses in higher education institutions offering the necessary skills and knowledge.','2014-11-17',NULL),(14,'conference_item',11,NULL,'Improving student employability by utilising semantic analysis of course data','pub','paper',NULL,NULL,NULL,NULL,NULL,'ICERI 2014 : 7th International Conference of Education, Research and Innovation','conference',NULL,NULL,NULL,16061,NULL,'http://eprints.mdx.ac.uk/id/eprint/16061',NULL,'This paper describes the development of a toolkit based on the semantic analysis of course data using the eXchanging Course Related Information &ndash; Course Advertising Profile (XCRI-CAP) information model. Based on the XCRI-CAP 1.2 standard, our research focused on providing the means for semantically comparing course descriptions and curriculum documentation. The paper provides an overview of how the JISC funded MUSAPI (Musket-Salami Project Integration) project resulted in the creation of a web service allowing (i) raising awareness regarding the architecture of job profiles and the employability terminology used in career services, (ii) identifying potential job opportunities for student graduates and/or university applicants, (iii) ranking &lsquo;real&rsquo; job opportunities filtered according to a range of criteria and (iv) mapping job opportunities to courses in higher education institutions offering the necessary skills and knowledge.','2014-11-17',NULL),(15,'conference_item',7,NULL,'Curriculum design for e-education: make effective use of course data','pub','speech',NULL,NULL,NULL,NULL,NULL,'International Conference on eBusiness, eCommerce, eManagement, eLearning and eGovernance 2014','conference',NULL,NULL,NULL,16063,NULL,'http://eprints.mdx.ac.uk/id/eprint/16063',NULL,'This paper provides an overview of how an XML-based information model is used for managing course data in e-education. The work presented in this paper has been funded by JISC as part of a number of projects under the e-learning programme and more specifically the course data coordination activities. The projects&rsquo; outputs included toolkits for generating, comparing, matching and using course data with the use of the XCRI-CAP information model that is known as eXchanging Course Related Information &ndash; Course Advertising Profiles. The initial stage of the project work focused on transforming course data descriptions in text format to XML files based on the XCRI-CAP model, allowing course providers to compare and contrast their provision according to the XCRI-CAP fields (e.g. duration, learning outcomes, description). The second stage of the project was concerned with the visualization of course data in a way that would allow course stakeholders (e.g. applicants, students, providers) to assess the extent to which, certain user-defined keywords exist in course definitions. Finally, the third project stage was focused on developing tools to match courses to potential job profiles in an attempt to align specific courses to available job opportunities. The paper provides a brief background on the project work and summarises the main outputs as walkthroughs of the developed toolkits.','2014-07-30',NULL),(16,'conference_item',10,NULL,'Curriculum design for e-education: make effective use of course data','pub','speech',NULL,NULL,NULL,NULL,NULL,'International Conference on eBusiness, eCommerce, eManagement, eLearning and eGovernance 2014','conference',NULL,NULL,NULL,16063,NULL,'http://eprints.mdx.ac.uk/id/eprint/16063',NULL,'This paper provides an overview of how an XML-based information model is used for managing course data in e-education. The work presented in this paper has been funded by JISC as part of a number of projects under the e-learning programme and more specifically the course data coordination activities. The projects&rsquo; outputs included toolkits for generating, comparing, matching and using course data with the use of the XCRI-CAP information model that is known as eXchanging Course Related Information &ndash; Course Advertising Profiles. The initial stage of the project work focused on transforming course data descriptions in text format to XML files based on the XCRI-CAP model, allowing course providers to compare and contrast their provision according to the XCRI-CAP fields (e.g. duration, learning outcomes, description). The second stage of the project was concerned with the visualization of course data in a way that would allow course stakeholders (e.g. applicants, students, providers) to assess the extent to which, certain user-defined keywords exist in course definitions. Finally, the third project stage was focused on developing tools to match courses to potential job profiles in an attempt to align specific courses to available job opportunities. The paper provides a brief background on the project work and summarises the main outputs as walkthroughs of the developed toolkits.','2014-07-30',NULL),(17,'conference_item',11,NULL,'Curriculum design for e-education: make effective use of course data','pub','speech',NULL,NULL,NULL,NULL,NULL,'International Conference on eBusiness, eCommerce, eManagement, eLearning and eGovernance 2014','conference',NULL,NULL,NULL,16063,NULL,'http://eprints.mdx.ac.uk/id/eprint/16063',NULL,'This paper provides an overview of how an XML-based information model is used for managing course data in e-education. The work presented in this paper has been funded by JISC as part of a number of projects under the e-learning programme and more specifically the course data coordination activities. The projects&rsquo; outputs included toolkits for generating, comparing, matching and using course data with the use of the XCRI-CAP information model that is known as eXchanging Course Related Information &ndash; Course Advertising Profiles. The initial stage of the project work focused on transforming course data descriptions in text format to XML files based on the XCRI-CAP model, allowing course providers to compare and contrast their provision according to the XCRI-CAP fields (e.g. duration, learning outcomes, description). The second stage of the project was concerned with the visualization of course data in a way that would allow course stakeholders (e.g. applicants, students, providers) to assess the extent to which, certain user-defined keywords exist in course definitions. Finally, the third project stage was focused on developing tools to match courses to potential job profiles in an attempt to align specific courses to available job opportunities. The paper provides a brief background on the project work and summarises the main outputs as walkthroughs of the developed toolkits.','2014-07-30',NULL),(18,'conference_item',7,NULL,'Making sense of course data: towards the standardisation of curriculum design and course related information','pub','paper',NULL,NULL,NULL,NULL,NULL,'6th International Conference on Education and New Learning Technologies (EDULEARN 2014)','conference',NULL,NULL,NULL,16068,NULL,'http://eprints.mdx.ac.uk/id/eprint/16068',NULL,'This paper provides a comprehensive description of the research conducted in a number of JISC funded projects in the past few years. The authors were involved in the development of educational planning tools supporting the direct comparison of course data. One of the main challenges in today\'s higher education is the lack of a consistent approach in the design and development of curriculum information. Although several quality assurance agencies exist world wide and ensure that there are certain criteria that must be adhered to when a new course is designed, there is still no widely acceptable format for documenting course data. This has allowed institutions to introduce their own templates, structures and techniques when producing information describing their courses. Furthermore, there are several terms that are frequently used interchangeably, causing confusion to the reader of course brochures (e.g. course, programme, class, module, lesson, learning experience). Typically, such readers involve several stakeholders of higher and further education courses such as applicants, students, parents and even academics. The paper describes the creation of a toolkit allowing the comparison of course data from different institutions based on semantic analysis of course description documents. The paper also discusses several contributions to research from the educational toolkit allowing the matching of user provided keywords to course content. Emphasis is given on explaining how the toolkit allows users to search course content by using several criteria including learning outcomes, indicative content, reading lists, etc. The paper also discusses how the project led to the enervation of a course data feed that can be used by any aggregator service allowing the creation of a national or even international repository of course data. Potentially the impact of the developed toolkit (that is based on the XCRI-CAP 1.2 standard) would support the harmonisation of course data representations and the exchange of course related data.','2014-07-07',NULL),(19,'conference_item',10,NULL,'Making sense of course data: towards the standardisation of curriculum design and course related information','pub','paper',NULL,NULL,NULL,NULL,NULL,'6th International Conference on Education and New Learning Technologies (EDULEARN 2014)','conference',NULL,NULL,NULL,16068,NULL,'http://eprints.mdx.ac.uk/id/eprint/16068',NULL,'This paper provides a comprehensive description of the research conducted in a number of JISC funded projects in the past few years. The authors were involved in the development of educational planning tools supporting the direct comparison of course data. One of the main challenges in today\'s higher education is the lack of a consistent approach in the design and development of curriculum information. Although several quality assurance agencies exist world wide and ensure that there are certain criteria that must be adhered to when a new course is designed, there is still no widely acceptable format for documenting course data. This has allowed ins