t comparison of course data. One of the main challenges in today\'s higher education is the lack of a consistent approach in the design and development of curriculum information. Although several quality assurance agencies exist world wide and ensure that there are certain criteria that must be adhered to when a new course is designed, there is still no widely acceptable format for documenting course data. This has allowed institutions to introduce their own templates, structures and techniques when producing information describing their courses. Furthermore, there are several terms that are frequently used interchangeably, causing confusion to the reader of course brochures (e.g. course, programme, class, module, lesson, learning experience). Typically, such readers involve several stakeholders of higher and further education courses such as applicants, students, parents and even academics. The paper describes the creation of a toolkit allowing the comparison of course data from different institutions based on semantic analysis of course description documents. The paper also discusses several contributions to research from the educational toolkit allowing the matching of user provided keywords to course content. Emphasis is given on explaining how the toolkit allows users to search course content by using several criteria including learning outcomes, indicative content, reading lists, etc. The paper also discusses how the project led to the enervation of a course data feed that can be used by any aggregator service allowing the creation of a national or even international repository of course data. Potentially the impact of the developed toolkit (that is based on the XCRI-CAP 1.2 standard) would support the harmonisation of course data representations and the exchange of course related data.','2014-07-07',NULL),(21,'article',11,NULL,'Curriculum design within a semantic information system','pub',NULL,NULL,'Key Engineering Materials','572',NULL,'Trans Tech Publications',NULL,NULL,NULL,'1013-9826',NULL,18099,'http://dx.doi.org/10.4028/www.scientific.net/KEM.572.562','http://eprints.mdx.ac.uk/id/eprint/18099',NULL,'There is a demand for powerful curriculum design systems to support the representation,\r\nexchange, integration and sharing of curriculum data over the internet; to meet the requirement, this paper use ontology to describe the concepts and their relationships in a specific domain, with which the author annotate the data models, and make sure the data model has structural information as well as semantic information. In this way, data transformation in a semantic consistent way is supported and query formulation is facilitated in the process; an ontology-based description model is also proposed to give expression and organisation of curriculum information.','2014-01-01','C'),(22,'article',7,NULL,'Curriculum design within a semantic information system','pub',NULL,NULL,'Key Engineering Materials','572',NULL,'Trans Tech Publications',NULL,NULL,NULL,'1013-9826',NULL,18099,'http://dx.doi.org/10.4028/www.scientific.net/KEM.572.562','http://eprints.mdx.ac.uk/id/eprint/18099',NULL,'There is a demand for powerful curriculum design systems to support the representation,\r\nexchange, integration and sharing of curriculum data over the internet; to meet the requirement, this paper use ontology to describe the concepts and their relationships in a specific domain, with which the author annotate the data models, and make sure the data model has structural information as well as semantic information. In this way, data transformation in a semantic consistent way is supported and query formulation is facilitated in the process; an ontology-based description model is also proposed to give expression and organisation of curriculum information.','2014-01-01','C'),(23,'article',12,NULL,'Curriculum design within a semantic information system','pub',NULL,NULL,'Key Engineering Materials','572',NULL,'Trans Tech Publications',NULL,NULL,NULL,'1013-9826',NULL,18099,'http://dx.doi.org/10.4028/www.scientific.net/KEM.572.562','http://eprints.mdx.ac.uk/id/eprint/18099',NULL,'There is a demand for powerful curriculum design systems to support the representation,\r\nexchange, integration and sharing of curriculum data over the internet; to meet the requirement, this paper use ontology to describe the concepts and their relationships in a specific domain, with which the author annotate the data models, and make sure the data model has structural information as well as semantic information. In this way, data transformation in a semantic consistent way is supported and query formulation is facilitated in the process; an ontology-based description model is also proposed to give expression and organisation of curriculum information.','2014-01-01','C'),(24,'article',8,NULL,'Curriculum design within a semantic information system','pub',NULL,NULL,'Key Engineering Materials','572',NULL,'Trans Tech Publications',NULL,NULL,NULL,'1013-9826',NULL,18099,'http://dx.doi.org/10.4028/www.scientific.net/KEM.572.562','http://eprints.mdx.ac.uk/id/eprint/18099',NULL,'There is a demand for powerful curriculum design systems to support the representation,\r\nexchange, integration and sharing of curriculum data over the internet; to meet the requirement, this paper use ontology to describe the concepts and their relationships in a specific domain, with which the author annotate the data models, and make sure the data model has structural information as well as semantic information. In this way, data transformation in a semantic consistent way is supported and query formulation is facilitated in the process; an ontology-based description model is also proposed to give expression and organisation of curriculum information.','2014-01-01','C'),(25,'conference_item',7,NULL,'Assessing the role of optical head-mounted displays in education: an investigation of Google Glass in creating learning portfolios and providing feedback','pub','paper',NULL,NULL,NULL,NULL,'IATED','8th International Conference on Education and New Learning Technologies','conference','9788460888604','2340-1117','EDULEARN16 Proceedings',22072,'http://doi.org/10.21125/edulearn.2016.2277','http://eprints.mdx.ac.uk/id/eprint/22072',NULL,'Technology Enhanced Learning is a field that has seen impressive developments over the past few years. Educators have experimented with the use of web technologies, introduced innovative e-learning approaches, extended the role of virtual learning environments and introduced learning analytics. The authors&rsquo; research aims to investigate how ubiquitous computing and augmented reality can further support students in a range of learning activities. In particular, this paper discusses a research study in the role of Optical Head-Mounted Displays (OHMD) in education. Emphasis is given on how the technology can enhance learning through the provision of additional support via augmented reality. \r\nThe paper describes how OHMD, and more specifically Google Glass has been used by students in a Higher Education Institution as part of their assessment. The research aim is twofold as it considers (i) the role of OHMD in supporting students during the creation of learning portfolios which can be used for formative and summative assessment, and (ii) the impact OHMD technology has in providing alternative ways of feedback. The scope of the research is to assess the suitability of the technology, the benefits that can be introduced in educational contexts as well as the perceived value of the technology from the learners&rsquo; point of view. \r\nThe first part of the study described in the paper describes how learners have used OHMD to construct a portfolio of learning evidence through cooperative evaluation of their work. In particular the study involved students using Google Glass to take snaps of their work, while recording a video diary of their contribution towards group coursework. Users reflected on the experience in terms of ease of use, simplicity and usefulness. They also evaluated the effectiveness of using OHMD during specific tasks including reading, writing and browsing. \r\nThe second part of the study is focused on providing feedback by using OHMD to attach vignettes on pictures of presentations. The technology is used for commenting on presentation content and delivery, while it is investigated as an alternative for providing feedback on practical activities. The paper also provides a detailed discussion of preliminary findings from the pilot with 92 participants studying at first and final years of a University degree.','2016-07-04',NULL),(26,'conference_item',8,NULL,'Assessing the role of optical head-mounted displays in education: an investigation of Google Glass in creating learning portfolios and providing feedback','pub','paper',NULL,NULL,NULL,NULL,'IATED','8th International Conference on Education and New Learning Technologies','conference','9788460888604','2340-1117','EDULEARN16 Proceedings',22072,'http://doi.org/10.21125/edulearn.2016.2277','http://eprints.mdx.ac.uk/id/eprint/22072',NULL,'Technology Enhanced Learning is a field that has seen impressive developments over the past few years. Educators have experimented with the use of web technologies, introduced innovative e-learning approaches, extended the role of virtual learning environments and introduced learning analytics. The authors&rsquo; research aims to investigate how ubiquitous computing and augmented reality can further support students in a range of learning activities. In particular, this paper discusses a research study in the role of Optical Head-Mounted Displays (OHMD) in education. Emphasis is given on how the technology can enhance learning through the provision of additional support via augmented reality. \r\nThe paper describes how OHMD, and more specifically Google Glass has been used by students in a Higher Education Institution as part of their assessment. The research aim is twofold as it considers (i) the role of OHMD in supporting students during the creation of learning portfolios which can be used for formative and summative assessment, and (ii) the impact OHMD technology has in providing alternative ways of feedback. The scope of the research is to assess the suitability of the technology, the benefits that can be introduced in educational contexts as well as the perceived value of the technology from the learners&rsquo; point of view. \r\nThe first part of the study described in the paper describes how learners have used OHMD to construct a portfolio of learning evidence through cooperative evaluation of their work. In particular the study involved students using Google Glass to take snaps of their work, while recording a video diary of their contribution towards group coursework. Users reflected on the experience in terms of ease of use, simplicity and usefulness. They also evaluated the effectiveness of using OHMD during specific tasks including reading, writing and browsing. \r\nThe second part of the study is focused on providing feedback by using OHMD to attach vignettes on pictures of presentations. The technology is used for commenting on presentation content and delivery, while it is investigated as an alternative for providing feedback on practical activities. The paper also provides a detailed discussion of preliminary findings from the pilot with 92 participants studying at first and final years of a University degree.','2016-07-04',NULL),(27,'conference_item',13,NULL,'Assessing the role of optical head-mounted displays in education: an investigation of Google Glass in creating learning portfolios and providing feedback','pub','paper',NULL,NULL,NULL,NULL,'IATED','8th International Conference on Education and New Learning Technologies','conference','9788460888604','2340-1117','EDULEARN16 Proceedings',22072,'http://doi.org/10.21125/edulearn.2016.2277','http://eprints.mdx.ac.uk/id/eprint/22072',NULL,'Technology Enhanced 