 of presentations. The technology is used for commenting on presentation content and delivery, while it is investigated as an alternative for providing feedback on practical activities. The paper also provides a detailed discussion of preliminary findings from the pilot with 92 participants studying at first and final years of a University degree.','2016-07-04',NULL),(28,'conference_item',7,NULL,'Using Optical Head-Mounted Devices (OHMD) for provision of feedback in education','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','12th International Conference on Intelligent Environments (IE)','conference','9781509040568','2472-7571','2016 12th International Conference on Intelligent Environments (IE)',22077,'https://doi.org/10.1109/IE.2016.34','http://eprints.mdx.ac.uk/id/eprint/22077',NULL,'This paper discusses the investigation of using Optical Head-Mounted Devices (OHMD) for provision of feedback in education. In particular it discusses an investigation in the use of Google Glass in real time training and mentoring. First the papers discusses an application created for the device for provision of feedback on student presentation. Next the paper presents, the research conducted with an experiment involving ninety-two participants testing the application in a real life scenario.','2016-10-27',NULL),(29,'conference_item',8,NULL,'Using Optical Head-Mounted Devices (OHMD) for provision of feedback in education','pub','paper',NULL,NULL,NULL,NULL,'Institute of Electrical and Electronics Engineers (IEEE)','12th International Conference on Intelligent Environments (IE)','conference','9781509040568','2472-7571','2016 12th International Conference on Intelligent Environments (IE)',22077,'https://doi.org/10.1109/IE.2016.34','http://eprints.mdx.ac.uk/id/eprint/22077',NULL,'This paper discusses the investigation of using Optical Head-Mounted Devices (OHMD) for provision of feedback in education. In particular it discusses an investigatio