tice in setting up supportive environments for collaborative learning. The paper discusses prior use of social media in learning support, the role of dashboards for learning analytics in Global Software Development training, the use of optical head-mounted displays for feedback and the use of NodeXl visualization in managing distributed teams. The scope of the paper is to provide a structured approach in organizing the creation of smarter teaching and training environments and explore ways to coordinate learning scenarios with the use of various techniques. The paper also discusses challenges from integrating multiple innovative features in educational contexts. Finally the paper attempts to investigate the use of smart laboratories in establishing additional learning support and gather primary data from blended and hybrid learning pilot studies.','2016-09-13',NULL),(32,'conference_item',8,NULL,'Creating smarter teaching and training environments: innovative set-up for collaborative hybrid learning','pub','paper',NULL,NULL,'21',NULL,'IOS Press','12th International Conference on Intelligent Environments (IE16) - Workshop','workshop','9781614996897','1875-4163','Intelligent Environments 2016: Workshop Proceedings of the 12th International Conference on Intelligent Environments',22084,'http://doi.org/10.3233/978-1-61499-690-3-238','http://eprints.mdx.ac.uk/id/eprint/22084',NULL,'This paper brings together previous work from a number of research projects and teaching initiatives in an effort to introduce good practice in setting up supportive environments for collaborative learning. The paper discusses prior use of social media in learning support, the role of dashboards for learning analytics in Global Software Development training, the use of optical head-mounted displays for feedback and the use of NodeXl visualization in managing distributed teams. The scope of the paper is to provide a structured approach in organizing the creation of smarter teaching and training 